INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("ぺコリーヌ", 8, 37, 150, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 1, 107501, 91002, 1, 0, 40001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("コッコロ", 8, 38, 150, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 1, 107601, 91002, 2, 0, 40001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("キャル", 8, 39, 150, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 1, 107801, 91002, 3, 0, 40001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("スズメ", 8, 40, 150, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 1, 107701, 91002, 4, 0, 40001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("タマキ", 8, 41, 150, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 1, 107901, 91002, 5, 0, 40001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("ぺコリーヌ", 8, 42, 150, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 2, 107501, 91002, 6, 0, 40001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("コッコロ", 8, 43, 150, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 2, 107601, 91002, 7, 0, 40001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("キャル", 8, 44, 150, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 2, 107801, 91002, 8, 0, 40001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("スズメ", 8, 45, 150, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 2, 107701, 91002, 9, 0, 40001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("タマキ", 8, 46, 150, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 2, 107901, 91002, 10, 0, 40001);
