INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("リリ", 2, 321, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 125801, 24001, 1, 0, 40011);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("クリア", 2, 322, 1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 126001, 24001, 2, 0, 40011);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("プレシア", 2, 323, 1, "んーと。\nこれ、あげる。\nはい", 1, 126101, 24001, 3, 0, 40011);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("リリ", 2, 324, 1, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 125801, 24001, 4, 0, 40011);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("クリア", 2, 325, 1, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 126001, 24001, 5, 0, 40011);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("プレシア", 2, 326, 1, "お兄。\nきてくれて、うれしい", 2, 126101, 24001, 6, 0, 40011);
